import React from 'react';
import MediaQuery from 'react-responsive';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import theme from '../theme/theme';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import logo from '../images/HeroBanner.jpg';


const useStyles = makeStyles((theme) => ({
    root: {
        // background: 'white',
        // position: '-webkit-sticky',
        // position: 'sticky',
        // top: 20,
        // bottom: 20, 
        paddingTop: '10px',
        paddingBottom: '10px',
        // boxShadow: '0px 2px 4px -5px rgba(0,0,0,0.2), 0px 4px 5px 0px rgba(0,0,0,0.14)'
    },
}));

export default function App() {

    const classes = useStyles();

    return (
        <div>
            <MediaQuery maxWidth={theme.breakpoints.values.iPhone678Plus}>
                <div align="left">
                    <img src={logo} alt="Website Logo" width="80%" />

                </div>
            </MediaQuery>

            <MediaQuery maxWidth={theme.breakpoints.values.iPad}>
                <div align="left">
                    <img src={logo} alt="Website Logo" width="80%" />

                </div>
            </MediaQuery>

            <MediaQuery minWidth={theme.breakpoints.values.iPad + 1}>
                {/* <AppBar position="relative" color="white" >
                    <div align="center">
                        <img src={logo} alt="Website Logo" width="70%" padding="20px" />
                    </div>
                </AppBar> */}

                <AppBar color="transparent" className={classes.root}>
                    <Toolbar>
                        <Grid container positionsticky="true" direction="row" justify="space-evenly" alignItems="center">
                            <Button color="paper" style={{fontSize: "16px"}}>Projects</Button>
                            <Button color="inherit" style={{fontSize: "16px"}}>Experience</Button>
                            <Button color="inherit" style={{fontSize: "16px"}}>Education</Button>
                            <Button color="inherit" style={{fontSize: "16px"}}>About</Button>
                            <Button color="inherit" style={{fontSize: "16px"}}>Contact</Button>
                        </Grid>
                    </Toolbar>
                </AppBar>
            </MediaQuery>
        </div>
    )
}
